import React from "react";
import './navbar1.css';
import cart from '../objects/logo/cart.jpeg'
import kart from '../objects/icon-kart.png'
import user from '../objects/user.jpeg'
const Navbar = () => {
 const [nav,setNav]=React.useState("");

  return (

    <div className="Navbar">
      <div Classname="sillydiv">
      <div className="Icon">
        <img alt="logo" src={cart} />
        <h2>E-cart</h2>
      </div>
      <div className="Menu">
        <ul>
          <li onClick={()=>(setNav("Men"))}>Men {nav==="Men"?<hr/>:null}</li> 
          <li onClick={()=>(setNav("Women"))}>Women {nav==="Women"?<hr/>:null}</li>
          <li onClick={()=>(setNav("Kids"))}>Kids {nav==="Kids"?<hr/>:null}</li>
          <li onClick={()=>(setNav("New"))}>New {nav==="New"?<hr/>:null}</li>
          <li onClick={()=>(setNav("Offers"))}>Offers {nav==="Offers"?<hr/>:null}</li>
        </ul>
      </div>
      </div>
      <div  class="userstuffs">
      <button>Login</button>
      <img class="iconone" alt="user" src={kart} />
      <img class="iconuser" alt="user" src={user} />
      </div>
    </div>
  );
};

export default Navbar;
